  return (
    <div class='col-md-3'>
      <div class='sidebar'>
        <p>Popular Tags</p>

        <div class='tag-list'>
          {props.articleLibrary && props.articleLibrary.forEach((article)=>{
            console.log(article.tagList.length)
            const tempTagList = []
            if(article.tagList.length !== 0){
              article.tagList.forEach((item)=>{tempTagList.push(item)
              })
            }
            console.log(tempTagList);

            // 我们就给他放在一个新的数据中 
