            programming
          </a>
          <a href='#top' class='tag-pill tag-default'>
            programming
          </a>
        </div>
      </div>
    </div>
  );
};


const mapStateToProps = state => {
  return { ...state };
};

const mapDismatchToProps = dispatch => {
  return {};
};

export const PopularTages = connect(
  mapStateToProps,
  mapDismatchToProps
